    ctx, cancel := context.WithTimeout(context.Background(), 10*time.Second)
    defer cancel()
    client, err := mongo.Connect(ctx, clientOptions)
    if err != nil {
        log.Fatal(err)
    }
    err = client.Ping(ctx, readpref.Primary())
    if err != nil {
        log.Fatal(err)
    }
    defer client.Disconnect(ctx)
    // DB := client.Database(&quot;cities-nighthack&quot;)
    // Cities := DB.Collection(&quot;city&quot;)

}

// model for user endpoint
type User struct {
    Email string `json:&quot;email&quot;`
}

// fake db to temp store users
var users []User

// checks if json is empty or not
func (u *User) IsEmpty() bool {
    return u.Email == &quot;&quot;
}

type App struct {
    Mongo *mongo.Client
}

func main() {
    setup()
    r := mux.NewRouter()
    r.HandleFunc(&quot;/user&quot;, createUser).Methods(&quot;POST&quot;)
    // r.HandleFunc(&quot;/suggest?city_name={city}&quot;, searchCity).Methods(&quot;GET&quot;)

    fmt.Println(&quot;Server running at port 8080&quot;)
    log.Fatal(http.ListenAndServe(&quot;:8080&quot;, r))

}

func createUser(w http.ResponseWriter, r *http.Request) {
    w.Header().Set(&quot;Content-Type&quot;, &quot;application/json&quot;)
    if r.Body == nil {
        json.NewEncoder(w).Encode(&quot;Must send data&quot;)
    }

    var user User
    err := json.NewDecoder(r.Body).Decode(&amp;user)
    if err != nil {
        log.Fatal(err)
    }
    if user.IsEmpty() {
        json.NewEncoder(w).Encode(&quot;Invalid! Enter user email.&quot;)
        return
    }
    users = append(users, user)
    json.NewEncoder(w).Encode(user)

}

func (a *App) searchCity(w http.ResponseWriter, r *http.Request) {

    vars := mux.Vars(r)
    city := vars[&quot;city&quot;]

}
</code></pre>
<p>I figured I'd be able to simply pass the handler like so:</p>
<pre class="lang-golang prettyprint-override"><code>func searchCity(city *mongo.Collection) (w http.ResponseWriter, r *http.Request) {
...
}
</code></pre>
<p>However, gmux doesn't allow you to do that since it implicitly passes in <code>http.ResponseWriter</code> and a <code>*http.Request</code>. Therefore, any input can't be in the arguments. I tried declaring them globally but that didn't work and was recommended not to do so. I was told I could try using a closure or a struct to pass it in but I don't quite understand how I'd go about doing that either.</p>

